    const yT=Math.max(y.getPixelForValue(b.y1),top), yB=Math.min(y.getPixelForValue(b.y0),bottom);
    if(yB<=yT) return;
    ctx.save(); ctx.fillStyle=b.col; ctx.fillRect(left,yT,right-left,yB-yT); ctx.restore();
  });
}};
const chart = new Chart(document.getElementById("chart").getContext("2d"),{
  data:{datasets},
  options:{
    animation:false,responsive:true,
    interaction:{mode:"nearest",intersect:false,axis:"x"},
    scales:{
      x:{type:"time",time:{unit:"day",displayFormats:{day:"MMM d"},tooltipFormat:"MMM d HH:mm"},ticks:{color:"#888",maxTicksLimit:16},grid:{color:"#2e3340"}},
      y:{min:0,max:200,title:{display:true,text:"AQI",color:"#888"},ticks:{color:"#888"},grid:{color:"#2e3340"}}
    },
    plugins:{
      legend:{display:false},
      tooltip:{callbacks:{label:i=>`Sensor ${i.dataset._sensor} (${i.dataset._kind==="scatter"?"raw":"median"}): AQI ${Math.round(i.parsed.y)}`}},
      zoom:{zoom:{wheel:{enabled:true},pinch:{enabled:true},mode:"x"},pan:{enabled:true,mode:"x"}}
    }
  },
  plugins:[bandsPlugin]
});
const leg=document.getElementById("legend"), hidden=new Set();
RAW.sensors.forEach(sid=>{
  const el=document.createElement("div"); el.className="legend-item";
  el.innerHTML=`<div class="legend-dot" style="background:${COLORS[sid]}"></div>${sid}`;
  el.onclick=()=>{ hidden.has(sid)?hidden.delete(sid):hidden.add(sid); el.classList.toggle("hidden"); chart.data.datasets.forEach(d=>{if(d._sensor===sid)d.hidden=hidden.has(sid);}); chart.update(); };
  leg.appendChild(el);
});
document.getElementById("resetZoom").onclick=()=>chart.resetZoom();
let sv=true;
document.getElementById("toggleScatter").onclick=function(){ sv=!sv; chart.data.datasets.forEach(d=>{if(d._kind==="scatter")d.hidden=!sv;}); this.textContent=sv?"Hide scatter":"Show scatter"; chart.update(); };
</script>
</body>
</html>
